import React from "react";

const CreateNote = () => {
  return (
    <>
      <div className="main_div">
        <form>
          <input type="text" placeholder="Title" />
          <textarea cols="30" rows="10" placeholder="Write a Note"></textarea>
        </form>
      </div>
    </>
  );
};

export default CreateNote;
